import React from 'react';


function Teble(props) {
    const columns = [{
        title: 'localName',
        dataIndex: 'localName',
        key: 'localName',
    },
    {
        title: 'enName',
        dataIndex: 'enName',
        key: 'enName',
    }
    ]
    const data = [
        {
            "id": 3,
            "createTime": "2021-03-08T07:04:59Z",
            "updateTime": "2021-03-08T07:04:59Z",
            "localName": "امارات متحده عربی",
            "enName": "United Arab Emirates",
            "shortCode": "AE",
            "otherName": null
        },
        {
            "id": 2,
            "createTime": "2021-03-08T07:04:59Z",
            "updateTime": "2021-03-08T07:04:59Z",
            "localName": "امارات متحده عربی2",
            "enName": "United Arab Emirates2",
            "shortCode": "AE2",
            "otherName": null
        }
    ]

    let headerIndex = []

    const createHeader = () => {
        let arrayHeader = []

        columns.forEach(it => {
            console.log('it :>> ', it)
            headerIndex.push(it.index)
            arrayHeader.push(
                <th key={it.key}>
                    {it.title}
                </th>
            )
        })
        return arrayHeader

    }

    const createData = (headerItem = []) => {
        let arrayData = []
        let obj = {}

        data.forEach(it => {
            obj = {}
            headerIndex.forEach(header => {
                Object.assign(obj, { header: it[header] })
            })
            arrayData.push(obj)
        })

        console.log('arrayData :>> ', arrayData);

    }

    return (
        <>
            <table style={{ width: "100%" }}>
                <thead >
                    <tr>
                        {createHeader()}
                    </tr>
                </thead>
                <th>Age</th>
                <tbody>
                    {createData()}
                    <td>Jill</td>

                    <td>Smith</td>
                    <tr>
                    </tr>
                    <td>Eve</td>
                    <td>50</td>
                    <td>Jackson</td>
                    <tr>
                    </tr>
                </tbody>
                <td>94</td>
            </table>
        </>
    );

}

export default Teble;

